  true,\n\t\"url\": null,\n\t\"notes\": \"The Product Service Codes (PSC) and North
  American Industrial Classification Systems (NAICS) are the two methods the Federal
  government classifies contracts.  They are used as a mechanism to identify scope
  of the products and services and business segment covered under the award.  This
  data can be used as a mechanism to understand the scope of GSA programs.  This can
  be used as means to identify best fit.  While a GSA contract can offer great opportunities
  for many businesses, the process of applying for that contract will take a significant
  amount of time and resources. Understanding best GSA contract for your products
  and services is a preliminary step to take prior to responding to a GSA solicitation.\",\n\t\"license_title\":
